import React from 'react';

const Footer = () => {
    return (
           <footer className="h-9 bg-white shadow-md mt-10 py-4">
            <p className="text-center text-gray-600">&copy; 2023 Your Company. All rights reserved.</p>
           </footer>
    );
};

export default Footer;
